Aide aux devoirs collège 
 Bonjour;

Je viens de finir mon année du bac qui était basée sur les spécialités de géo politique et je suis également calé sur d'autre matières donc contacter moi si l'envie est au rendez-vous de plus si les devoir me semble plutôt modeste, je peux faire un prix histoire d'être reglo.
